import styles from "./Boton.module.css";

export default function Boton(props) {

    let style = "";
    switch (type) {
        case "reset":
            style = "limpiar"
            break;
        case "submit":
            style = "aceptar";
            break;
        case "cancel":
            style = "cancelar";
            break;
        default:
            style = "none";
            break;
    }

    return (
        <button className={styles[style]} type={props.type} onClick={props.onClickFunction}> 
            {props.text}
        </button>
    );
}
